<template>  <div>    <el-row>      <el-col :span="6">        <el-form-item label="Remote Data Source">          <el-switch v-model="activeField.isFromUrl">{{            activeField.htmlContent          }}</el-switch>        </el-form-item>      </el-col>      <el-col :span="18">        <el-form-item v-show="activeField.isFromUrl" label="Url" prop="dataUrl">          <el-input v-model="activeField.dataUrl"></el-input>        </el-form-item>      </el-col>    </el-row>    <el-row v-show="activeField.isFromUrl">      <el-col :span="4">        <el-form-item v-show="activeField.labelField" label="Fetch Data">        </el-form-item>      </el-col>      <el-col :span="10">        <el-form-item v-show="activeField.labelField" label="Label Field">          <el-input v-model="activeField.labelField"></el-input>        </el-form-item>      </el-col>      <el-col :span="10">        <el-form-item v-show="activeField.valueField" label="Value Field">          <el-input v-model="activeField.valueField"></el-input>        </el-form-item>      </el-col>    </el-row>  </div></template><script>import fetchData from '@/plugins/api/fetch-data';export default {  name: 'SelectListAdvancedProp',  data() {    return {      activeField: this.$store.state.activeField,    };  },  methods: {    fetchData() {      const dataUrl = this.activeField.dataUrl;      const valueField = this.activeField.valueField;      const labelField = this.activeField.labelField;      if (!dataUrl) {        this.$message.error('Url can not be empty');        return;      }      if (!valueField) {        this.$message.error('Value Field can not be empty');        return;      }      if (!labelField) {        this.$message.error('Label Field can not be empty');        return;      }      const promise = fetchData.fetchOptionsData(        dataUrl,        labelField,        valueField      );      promise.then((data) => {        this.activeField.options = data;      });      this.$message({        showClose: true,        message: 'Success.',        type: 'success',        duration: 1000,      });    },  },};</script>